  display:flex;
  margin: 50px 100px; //수정예정
  justify-content:flex-start;
`
const ProfileImg=styled.img`
  border-radius:50%;
  width:38px;
  height:38px;
  object-fit:cover;
  margin-right:25px;
`
const ProfileText=styled.div`
  font-size:20px;
  margin-bottom:2px;
  font-weight:bold;
`
const ChangeProfile=styled.div`
  font-size:14px;
  color:#0095f6;
  font-weight:bold;
`
const NameDiv=styled.div`
  display:flex;
  justify-contet:flex-start;
  align-items:center;
`
const Name=styled.div`
  font-size:20px;
  font-weight:bold;
  margin-right:25px;
`
const NameInput=styled.input`
  width: 50%;
  height:32px;
  padding:0 10px;
  border-radius:3px;
  border:solid 1px #dbdbdb;
`
