`
const WebSiteDiv=styled.div`

`
const PrivateDiv=styled.div`

`
const RecommandDiv=styled.div`

`

function Edit() {
  return (
    <Div>
      <ProfileDiv>
        <ProfileImg src='../images/activeStatus/photo.png'></ProfileImg>
        <div>
        <ProfileText>username</ProfileText>
        <ChangeProfile>프로필 사진 바꾸기</ChangeProfile>
        </div>
      </ProfileDiv>
      <NameDiv>
        <Name>이름</Name>
        <NameInput value='USER'></NameInput>      
      </NameDiv>
      <NickNameDiv></NickNameDiv>
      <WebSiteDiv></WebSiteDiv>
      <PrivateDiv></PrivateDiv>
      <RecommandDiv></RecommandDiv>
    </Div>
  );
}

export default Edit;
